import React, { Component } from "react";
import "./Main.css";
import Booklist from "../Booklist/Index";

class Main extends Component {
    render() {
      const { isFetching, characters, filteredCharacters } = this.props;
      return (
        <main className="appMain row">
        <div className="left_app col-md-2">
          <p className="texto1">que tal majo</p>
        </div>
        <div className="right_app col-md-10">
         <Booklist/>
        </div>
        </main>
      );
    }
};
export default Main;
